import React, { Component } from "react";
import Header from "../Components/home/Header";
import SearchTabs from "../Components/home/SearchTabs";

class home extends Component {
  render() {
    return (
      <div>
        <Header />
        <div>
          <SearchTabs />
        </div>
      </div>
    );
  }
}

export default home;
